import React from "react";
import navCode from "../assets/file-code.svg";
import navWork from "../assets/briefcase.svg";
import navAbout from "../assets/file-earmark-person.svg";
import navContact from "../assets/phone.svg";

function NavModal({ navModal }) {
  return (
    <div id="navModal">
      <div className="navButtons">
        <img
          src={navCode}
          id="navCode"
          style={{ color: "#ffffff" }}
          alt="Navigation Bar Button Code"
        />
      </div>
      <div className="navButtons">
        <img
          src={navWork}
          id="navWork"
          style={{ color: "#ffffff" }}
          alt="Navigation Bar Button Work"
        />
      </div>
      <div className="navButtons">
        <img
          src={navAbout}
          id="navAbout"
          style={{ color: "#ffffff" }}
          alt="Navigation Bar Button About"
        />
      </div>
      <div className="navButtons">
        <img
          src={navContact}
          id="navContact"
          style={{ color: "#ffffff" }}
          alt="Navigation Bar Button Contact"
        />
      </div>
    </div>
  );
}

export default NavModal;
